import React from 'react';
import styled from 'styled-components';
import Header from './Header';

type Props = {
  children: React.Component;
};

const LayoutRoot = styled.div`
  display: flex;
`;

const Layout: React.FC<Props> = (props) => {
  return (
    <LayoutRoot>
      <Header />
      {props.children}
    </LayoutRoot>
  );
};

export default Layout;
